import React from "react";
import styles from "./Currency.module.css";
import Wrap from "../Wrap/Wrap";

const Currency = () => {
  return <Wrap className = {styles.currenceWrapper}>
    
    Currency

    <div>

        <div>
            <img></img>
            <span></span>
        </div>
        
    </div>

  </Wrap>;
};

export default Currency;
